import React from "react";
import SearchIcon from '@mui/icons-material/Search';
import { Box } from "@mui/material";
import { InputBase } from '@mui/material';

const Search=()=>{
    return (
        <Box>
            <Box>
                <Box>
                    <SearchIcon />
                </Box> 
                    <InputBase />
            </Box>
        </Box>
    );
}

export default Search;
